import React, {useEffect} from 'react'
import {HeaderTitle} from '../../../components/HeaderTitle/HeaderTitle'
import {modelFactory} from '../../../ModelAction/modelUtil'
import {doc} from '../../../graphqlTypes/doc'
import {DictTypeEnum} from '../../../ss_common/enum'
import {DataConfigItemInput} from '../../../graphqlTypes/types'
import {useStoreModel} from '../../../ModelAction/useStore'
import {fpMergePre} from '../../../tools/utils'
import styled from 'styled-components'

const pickupAddressModel = modelFactory('pickupAddressModel', {
  list: [],
}, {
  getList: async (value, option) => {
    const res = await option.query(doc.getDataConfig, {
      data: {
        type: DictTypeEnum.SelfAddress,
      } as DataConfigItemInput,
    })
    option.setData(fpMergePre({
      list: res?.getDataConfig?.value?.list ?? [],
    }))
  },

})

const ItemBox = styled.div`
  
`

export const PickupAddress = () => {
  const {actions: actionsPAM, state: statePAM} = useStoreModel(pickupAddressModel)
  useEffect(() => {
    if (!statePAM.list.length) {
      actionsPAM.getList()
    }
  }, [])

  console.log(statePAM.list[0])

  return <div>
    <HeaderTitle
        title={'我的取货点'}
    />
    {statePAM.list.map((value: any) => <ItemBox key={`PickupAddress_${value.id}`}>
      {value.id}
    </ItemBox>)}
  </div>
}
